<h2 style="padding-top: 6pt;padding-left: 6pt;text-indent: 0pt;text-align: left;">Informatie</h2>
<p style="padding-top: 2pt;padding-left: 6pt;text-indent: 0pt;line-height: 8pt;text-align: left;">Volgens de wet mag het
    verlies van telefoondienst verstrekt aan de abonnee tijdens de nummeroverdrachtsprocedure niet langer dan</p>
<p class="s31" style="padding-left: 6pt;text-indent: 0pt;line-height: 81%;text-align: left;">1 werkdag duren. U dient
    een specifieke datum overeen te komen voor de overdracht van het nummer met uw operator. Indien de overdracht <span
            class="p">langer dan een werkdag duurt na de activering van de telefoondienst of indien de overeengekomen datum niet wordt nageleefd, hebt u recht op een compensatie. Hiervoor moet u zich wenden tot uw nieuwe operator. Meer informatie over uw recht op compensatie bij vertraging in de nummer-</span>
</p>
<p style="padding-left: 6pt;text-indent: 0pt;line-height: 9pt;text-align: left;"><a href="http://www.bipt.be/np"
                                                                                    class="a" target="_blank">overdracht
        vindt u op </a><a href="http://www.bipt.be/np" target="_blank">www.bipt.be/np.</a></p>
<p style="padding-top: 9pt;padding-left: 6pt;text-indent: 0pt;line-height: 75%;text-align: left;">De overdracht van
    nummers en vastelijndiensten naar Orange ontslaat u niet van de verplichting om uw contract met de oorspronkelijke
    operator te <span class="s31">respecteren, op straffe van het betalen van nalatigheidsinteresten of een schadevergoeding aan deze operator.</span>
</p>
<p style="padding-left: 6pt;text-indent: 0pt;line-height: 7pt;text-align: left;">De vastelijndiensten kunnen bij uw
    oorspronkelijke operator samen met mobiele en/of vaste nummers worden aangeboden. Het stopzetten van de</p>
<p style="padding-left: 6pt;text-indent: 0pt;line-height: 92%;text-align: left;">internet en/of tv-diensten zonder
    overdracht van de telefoonnummers kan tot gevolg hebben dat de oorspronkelijke operator het volledige contract
    automatisch zal stopzetten met mogelijk verlies van telefoonnummers.</p>
<p style="padding-left: 6pt;text-indent: 0pt;line-height: 92%;text-align: left;"><a
            href="http://www.orange.be/easyswitch" class="a" target="_blank">Indien de technicus voor de installatie van
        vaste lijndiensten niet komt opdagen binnen het afgesproken tijdsblok hebt u recht op een compensatie van 10
        euro. Voor meer informatie zie </a><a href="http://www.orange.be/easyswitch" target="_blank">www.orange.be/easyswitch.</a>
</p>
<p style="padding-top: 8pt;padding-left: 6pt;text-indent: 0pt;line-height: 92%;text-align: left;">De klant geeft Orange
    volmacht om in zijn naam het bestaande contract met betrekking tot de hierboven vermelde diensten en nummers met de
    oorspronkelijke operator op te zeggen en naar Orange over te dragen. De overdracht kan enkel plaats vinden indien de
    klant de correcte en volledige gegevens meedeelt en de oorspronkelijke operator deze aanvraag geldig verklaart. Met
    het tekenen van dit document verklaart u zich akkoord met de algemene voorwaarden van Orange (link) en Easy Switch
    (link). Uitsluitend de persoon die geabonneerd is bij de oorspronkelijke operator kan dit document ondertekenen.</p>
